		"text": "하루히는 사실 그녀 또한 얼핏 평범한 측의 사람처럼 보이는 포지션이었고, 또 그러한 톤이었기에 괜찮았지만...\n\n여성측이 정상성에서 더 일탈해 있는 것은 비정상성에 대한 동경의 투영이기에(이질/이성). 그러나 그녀의 구원은 정상성으로부터의 승인.",
