		"id_str": "984533975593975808",
		"text": "반면 좋은 비평은 평자의 가치 판단 체계로 독자를 이끌어오는 것. 그러나 그러한 좋은 비평은 긴 글이 되기 마련이고, 책의 형태를 요청한다. 주류의, 기성의 사고 방식만이 유통되는 현실은, 책이 읽히지 않는 시대의 당면 문제.",
